class NewtopicComponent {
    constructor(service, router) {
        this.service = service;
        this.router = router;
        this.status = '';
        this.user_id = '';
    }
    resetForm(form) {
        if (form != null)
            form.resetForm();
        this.service.formData = {
            id_topics: 0,
            id_usuario: parseInt(this.user_id),
            titulo: '',
            contenido: '',
            fecha_creacion: new Date(),
            fecha_modificacion: new Date(),
        };
    }
    onSubmit(form) {
        form.value.id_usuario = parseInt(this.user_id);
        this.insertRecord(form);
    }
    insertRecord(form) {
        this.service.postTema(form.value)
            .subscribe(res => {
            this.resetForm(form);
            this.resetForm();
            this.router.navigate(['/topicos']);
        }, (err) => {
            var MensajeError = err.error.message;
        });
    }
    ngOnInit() {
        this.user_id = localStorage.getItem('user_id');
        this.status = localStorage.getItem('resultado');
        if (parseInt(this.status) == 0) {
            this.router.navigate(['/levelaccessforo']);
        }
    }
}
