function formatDATE(date) {
    var mm = date.getMonth() + 1;
    var dd = date.getDate();
    var yy = date.getFullYear();
    if (mm <= 9 && dd <= 9) {
        var myDateString = yy + '-0' + mm + '-0' + dd;
    }
    else if (mm <= 9) {
        var myDateString = yy + '-0' + mm + '-' + dd;
    }
    else if (dd <= 9) {
        var myDateString = yy + '-' + mm + '-0' + dd;
    }
    else {
        var myDateString = yy + '-' + mm + '-' + dd; //(US)
    }
    return myDateString;
}


